@captainsordersx - would be granted. 

A week and then he would be on some remote far away planet doing whatever he wanted. 

       — the woman seemed to be preoccupied when he arrived, He said nothing as he stood there with a tray of water and a sandwich.  He didn’t dare to interrupt, so he -

@captainsordersx Krei had been back on the base for a total of twenty four hours, His plan was to request some leave so he could unwind and just... 

        𝐵𝑟𝑒𝑎𝑡ℎ𝑒

However Kylo had other plans, a personal guest was in need of keeping an eye on. If Krei could handle that then his leave -

@NOTAJEDl “Oh no, I don’t just say things.” 

He shook his head while turning away himself, His eyes scanning the cantina before them. 

“I don’t do unnecessary flattery, and I don’t lie.”

@NOTAJEDl “I mean it..” 

 He lowered his hand back to the table, Nursing the glass. 

“It may have been hidden behind a joke, but I mean it. Had you have turned me down, I would have felt it deeply”

@NOTAJEDl “Oh! Good..” He held his hand against his chest while looking at Ahsoka, feigning a look of relief. 

He found himself relaxing a little more with the time spent with her, But not too much. 

“I was very afraid, I am unsure my heart could take it”

@NOTAJEDl “To my knowledge... no.” 

He hadn’t wanted it to come out sounding cocky but, He did pride himself on being ... well, Likeable. 

“But, there is always a first for everything”

@tcarsofthestars “You took my hand didn’t you?” 

He drew her in closer before stepping into her side, He was very curious about this one. Perhaps that was why he was helping her. 

“Now where are you headed?”

@tcarsofthestars Krei eyed the revealed Lekku, He was not unfamiliar with her kind. 

“If you are requiring protection.—” He started, But he soon stopped himself and now, it was his turn to hold his hand out to her. 

“— I can help.”

@tcarsofthestars “And what makes you think your life is in any less danger now?” 

A brow rose while he observed the woman, Looking her over while she stood before him. 

“What has you so spooked?”

@tcarsofthestars He is, Very displeased at the fact he had been thrown to the floor so carelessly.  

Taking the hand, he stood looking down at the smashed data pad. 

“You really ought to be more careful!”

@NOTAJEDl “If truth be told, I have been meaning to ask you for months..” 

He lowered his glass while he looked across at Ahsoka, his eyes had skimmed over her while observing the Togruta’s form. 

“It had been a matter of if I could handle the rejection or not.”

@NOTAJEDl “Hm, I wasn’t sure if this was too over the top.” 

He did feel a little out of place in his casual clothing, So much that he brushed his hands down over his shirt before directing his attention back to Ahsoka. 

“I do hope you can forgive me being late”

@kylosnightmare “It isn’t much of a problem.” 

He was not unfamiliar with injuries, Krei had suffered from many in his life some inflicted by his will. Regardless, He raised an arm for the general’s inspection. 

“If it is what you wish..” Krei looked from his side and then back to Armitage.

@kylosnightmare “They are confident.” 

He all but confirmed while he looked over his shoulder at the General. 

“Too many seem to be swayed by their cause. That’s a problem.”

@TragediesFinest Sitting up completely while he looked at Valaris. 

“You would?” He wasn’t sure why he was so surprised by it, but he was. Perhaps he thought she could do better, someone more higher ranking. 

“I mean, of course.”

@TragediesFinest “Well..—“ 

He lifted himself enough to rest on his elbows and look up at Valaris. 

“Maybe you would like to come to dinner with me?”

@TragediesFinest “Oh, Now my feelings are hurt..” 

He may be feigning a pout while he looks up at his lieutenant. 

“Well, since I have you here. I do have a question for you.”

@TragediesFinest “I am available if you require attention..” 

Shoving away what he was working on while turning to fully face the Lieutenant. 

“Unless you have plans already.”

@TragediesFinest He stops what he is doing immediately and turns his head but a fraction. 

“That’s where you are. I have been looking for you.” 

He has done much searching, as one can tell.

@TragediesFinest The moment she turned toward him, Krei tilt his head to observe her features a little more. 

There was a twinge on a grin at the utterance of her words. 

“As it is for me also.”

@TragediesFinest He was beginning to think she’d died.. 

“Good to see you’re alive..” 

Casually strolling over to her side, amused.

@ATouchOfForce ..... 

..............

Scowls “shut up.”

@TragediesFinest He didn’t like how she looked at him, But at the same time he found himself wanting her to look at him like that more often. 

“Well...” 

That’s all he said before he quickly leant forward and pressed his lips against hers. Truth be told she could have pushed him away or hit -

@TragediesFinest Krei made himself at home now that she had shown she was awake. 

He rested his head back against his arm while he looked over at Mauve. She was really beautiful; Not that he would tel her that at the moment. Maybe another time, But for now.. 

“Is that why your hair looks like -

@TragediesFinest - her awake. 

He did lean closer to her. 

“I am going to just lay here, Maybe I’ll have a nap... Borrow your shower.. use all your hair shampoo..”

@TragediesFinest “Mauve..” 

He waited to see if she would open the door. It wasn’t like him to just walk in but since Mauve was being difficult, He decided to test the locks. 

A finger pressed against the button of her door, stepping back he watched it open before he stepped into the room. -

@TragediesFinest “You like me Mauve; I am reachable by commlink yet you seek me out personally..” 

He did release her hand only because she seemed so certain to remove it from his grasp. 

“Yes; Both of us... tell me, have you thought about what I said the other day.. about what I can give you?”

@TragediesFinest “You are often wondering where I am, are you not?” 

He is going to casually reach out and stop her hand because that’s getting a little distracting. He won’t release her hand though. 

“You know, the sooner you admit you like me. The easier it will be for us both.”

@TragediesFinest A small frown appeared upon his features; Krei rather liked being this close to Val. She was beautiful and had a nice smell about her. 

His hand came up to brush away fallen strands of her hair from her face. 

“Oh? Where do you think you left them?” He didn’t want her running -

@TragediesFinest “Sweetheart; I already told you. I don’t have your tools.” 

He shifted his body slightly so he could be far more comfortable then he was, But not enough that it would shift her form at all. 

“Though please continue to believe I do if it means you’ll remain like this”

@TragediesFinest Of course he wouldn’t. He rather liked her where she was right now, on top and all authoritative like. 

Nice. 

“Now, Thats not nice. Here I am being all sweet to you.”

@TragediesFinest “Hm; No?”

This was a very interesting turn of events. There was definitely not a sign of complaint coming from Krei. 

“I have no idea what you’re talking about.”

