@TragediesFinest “Hm, Maybe. But none interest me as much as you.” 

What type of interest did he have with her? He wasn’t entirely sure. But he had found himself curious about the pesky little Lieutenant, so much so that he had actively sought her out to be helps distraction. 

“What planet -

@TragediesFinest Krei’s actions paused, Even the twirling of the pen had stopped long enough for him to turn and face her. 

     Dark eyes roaming over the females form before he turned away. 

“A distraction I need, So no... decidedly not”

@TragediesFinest “Don’t be so ridiculous, Mauve.” 

He picked up a pan and turned it over between his fingers with a quick glance to the woman. 

“You are a distraction. Nothing more..”

@TragediesFinest The punch caught him off guard, But he had recovered quickly. 

Swiping his hand under his nose there had been small traces of blood. 

With a short huff and a flick of his wrist, He sent the small woman back on her rear.

@TragediesFinest “V a l..” He tried that name first. 

“Mauve..” and the second. He wasn’t sure he enjoyed either name but he shrugged. 

“What do you do, Val”

@SheIsDeath “As always” 

He gave a little squeeze. 

“I’ve been, Busy. It’s of no importance now. I’m back for sometime.”

@SheIsDeath Was he not supposed to look at her.

Ah ha!! That made him laugh.. 

Mimics her actions though he doesn't do it quiet as well as she does.

@OfPrideandHonor “I’ll change the link, and you should know I’m not always on base..” 

Sighing softly, He pinched the bridge of his nose. 

“Bini, you need to stop...”

