@VersatileWrath He was always so.. Weird when it came to presents, He never knew how to accept them without feeling awkward.

However in his reach for the item he stopped briefly when she had said the location of its design, Turning it over it his fingers.. 

"I can't say I am thrilled at the -

@VersatileWrath "That would be nice, It's rare I get visitors lately.. Plus, It would surely piss off him.."

Smiling while he allowed his head to rest against hers with a small sigh. 

"I will speak with Kylo for you.."

@BreakByForce "Um, Working..

Wrinkling his nose a little.. 

"what are you doing? Pax.."

@BreakByForce Quickly, Jerking his hands back away from the screen in front of him as Pax made it his mission to get between Krei and his work.. 

Sitting back in his seat.

"Hello..."

@FightBleedDie OH MY GODS..

Staring off into the distance. 

"I remember. Just like how you're my sister.. Right? and I am never cruel to you, name one time?"

@ATouchOfForce “The prison. . . mostly, spent a few months in the Outer rim.” 

watches carefully while his arm is chewed on.

“Is that arm to your liking?”

@NiaRenSW “They have a safe environment to learn, both sides of the force instead of biased beliefs...” 

Krei kept all attention on Nia, Even If he wasn’t looking directly at her. She had his focus. 

“Maybe, But you’re still one of the most frightening ones. You certainly know how to -

@NiaRenSW “You have an amazing network of connections, They’ll come around.. to help the next generation..” 

Krei nodded with absolute certainty. 

“And you’re absolutely terrifying when you’ve been crossed, You can not convince me otherwise..”

@NiaRenSW “You’re running a school that we needed, It would be nice to see how that works out, Would you mind if I stuck around for a few days?” 

Krei laughed with a shake of his head. 

“I don’t need to threaten anyone, I think he has to worry more about you then me..”

@NiaRenSW “You trust me not to corrupt your students?” 

He was teasing, He’d never be able to tell Nia no. 

“I would like to meet him, I think. Yes.. I would like that..”

@NiaRenSW “I have done my best under the circumstances..” 

A look over and Krei was satisfied that Nia was visually well. 

“How are things here? Not boring I hope..”

@VersatileWrath Message for Osa. 

:Dumb shit long gone. We are fine. Not as fin.. (Message Deleted) 

: He is still a dumb shit but he isn’t being controlled by the power of bad pussy if that’s what you mean.

@NiaRenSW Landing, Krei made his way down the ramp of his ship to meet her. 

His eyes scanning over her for signs of distress but pleased with her outward appearance he smiled 

“Hello sweetheart..”

@ATouchOfForce “Anytime..” 

Shrugging staring at the roof.

“Looking at the roof”

@NiaRenSW "Of course I have.. and that never works, So, I fight him. He cares, He doesn't show it. But he does.."

 Reaching over he places his hand over hers for a moment.

"We love you, We've become creatures of habit.. So when you left.. It was a change we didn't know how to handle."

@NiaRenSW He laughed, Not a bitter one, A real one.
"You two need to talk, work on that bond together. Like Falon and I, Don't shut each other out. You're working against each other, Not together.." He smiled sadly.

"We were both kind of bitter about your leaving"

@NiaRenSW He doesn’t look away from his book. 

“You look beautiful..” 

He finished the page before closing the book to give his attention to Nia.

@SheIsDeath Why is she red

“How are you today?” 

He had a lot to tell her.

@ATouchOfForce - That he hadn't experienced in such a long time.

Krei settled beside Varrys, His own arms around the other male, Holding tightly while a sigh fell from his lips.. 

"I'm here!"

@RavageTheGalaxy @ATouchOfForce That's still gross..

"Thanks..?" She was probably right though.. Leaving Vala to her, Valaness. 

Krei walked out with his soup.

@RavageTheGalaxy "Good.." 

Little disappointed the soup was gone, Otherwise, He did as he was told once again..

Sticking his tongue out for Vala.

@RavageTheGalaxy "That's part of why I am here" 

He was still teasing the spoon through the soup.

"You said, Something of sentimental value that I would miss.. Would a feeling for a particular person work? Not the entire feeling, But for a specific person"

@TheFaceOfASon Krei rolled his eyes..

But shrugged it off.

"I'll be going back, With or without him.. But I do have things here to do first."

@TheFaceOfASon Krei instinctively reached out to touch Kylo's hair. 

"I have to take him back with me.." Krei was glad for the quiet moment with Kylo. They hadn't talked like this in so long..

"You know I have to take him back. I need him back on my side.."

@SheIsDeath Sighing as he looked at her with understanding..

“I know, That was part of why I was coming to see you. I was hoping to get a ride back with you.” 

He enjoyed having Fallon here, But he didn’t want her to fall behind..

@SheIsDeath “Yes you are” 

He’s laying her down in his bed and joining her 

“Sleep Fallon”

@SheIsDeath He liked to see her enthusiasm, even if it was misplaced. She wasn't what people thought she was, They just refused to get to know her.

Probably the stormtrooper thing,,

"The difference is importance, OR crime. The ones that are kept back home are providing information. The -

@SheIsDeath Laughing "Okay, Okay!.." 

He was happy the mood had lifted, Even if it's slightly..

"So where is 301? Did you bring him?"

@SheIsDeath Good, Good.. 

He's just,,

Picking her up and carrying back to the room..

@SheIsDeath Okay, But.. Privately..

She can stay the way she is.

If she wants..

@SheIsDeath Krei didn't want to move. This had been the first time he'd felt some sort of peace.. Partially balanced.. 

However, He pulled back with a nod.

"Come on, I'll show you, Your room and mine." He smiled warmly at Fallon while leading her out of the hangar.

@SheIsDeath [No]

[Ye- No]

[When can you get here?]

@ATouchOfForce Krei was up and already blocking the door way. 

“No. I’ll leave.  You two are killing me here..” 

Krei was already turning, One night.. just one night without arguing.

@ATouchOfForce Settles and gets comfortable

“She smells lovely”

Looks at Varrys “what’s wrong”

@ATouchOfForce Kreis letting himself in. 

Stop him. 

Flops on Varrys bed.

@NiaRenSW Krei smiled with a nod. 

He was glad. Honestly. 

"Good, Have you figured out what's the source of your balance?"

@NiaRenSW Nodding, He returned to the desk with two cups. One for Nia, The other for him.

"It is. But, Enough about me.. I want to know, You and Ferox.. Are things better?" 

He meant from the last time they spoke and the result of the bond was having on her relationship.

@ATouchOfForce Counts on fingers.

Krei, Nia.... 

Third one not found..

@ATouchOfForce He won't break this tea cup..

Not yet.. 

"Nice day out?"

@NiaRenSW "Anyone who minds doesn't matter Nia, You've told me that when I was still Xylas.."

Krei was happy for Nia..

"Im glad.. Did you say it back? Or did you leave him hanging..-" He was trying to lighten the mood "-Things change its how we accept those changes that matter"

@SheIsDeath "Well, Some do.." He was kidding, but kind of not kidding.. 

"Anything you want. Some train for fun, Others fly out to a bar.. I like to read.. I do that a lot.." 

Way to sound boring Krei.

@RightHandRen "Understandable.." 

Escorting Ferox to the ship was nothing anyone hadn't done before.. They'd all done the same thing with their own ships.. 

Krei was just wanting to get to his own location before anyone questions what took so long..

@RightHandRen "Ready.." 

Krei had a small bag, But most of his stuff had already been taken to the ship. 

"Ready to be back with Nia..?" It wasn't meant as a nosey question.. more out of curiosity ..
